    { name = "rich" },
]

[package.dev-dependencies]
dev = [
    { name = "ruff" },
]

[package.metadata]
requires-dist = [
    { name = "langdetect", specifier = ">=1.0.9" },
    { name = "playwright", specifier = ">=1.40.0" },
    { name = "pydantic", specifier = ">=2.5.0" },
    { name = "pydantic-settings", specifier = ">=2.1.0" },
    { name = "pytest", specifier = ">=8.0.0" },
    { name = "pytest-asyncio", specifier = ">=0.24.0" },
    { name = "pytest-html", marker = "extra == 'reporting'", specifier = ">=4.1.0" },
    { name = "python-levenshtein", specifier = ">=0.25.0" },
    { name = "rich", marker = "extra == 'reporting'", specifier = ">=13.7.0" },
]
provides-extras = ["reporting"]

[package.metadata.requires-dev]
dev = [{ name = "ruff", specifier = ">=0.14.10" }]
